import {reqUserAddress} from '@/api/index'
const state = {
    userAddress:[]
}
const mutations={
    GETUSERADRESS(state,data){
        state.userAddress = data
    }
}
const actions={
    async getUserAdress({commit}){
        let result = await reqUserAddress()
        if(result.code===200){
            commit("GETUSERADRESS",result.data)
            return 'ok'
        }
        else{
            return Promise.reject(new Error(data.message))
        }
    }
}
const getters={}
export default {
    state,
    mutations,
    actions,
    getters
}
